import{_ as e,o as l,c as a,Q as i}from"./chunks/framework.45bffcbf.js";const d=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"docs/mysql/basic/index.md","lastUpdated":1693220439000}'),o={name:"docs/mysql/basic/index.md"},s=[i("<p><code>MySQL</code> 是最流行的关系型数据库管理系统，在 <code>WEB</code> 应用方面 <code>MySQL</code> 是最好的 RDBMS(Relational Database Management System：关系数据库管理系统)应用软件之一。</p><p>数据库（<code>Database</code>）是按照数据结构来组织、存储和管理数据的仓库。</p><p>数据以表格的形式出现, 每行为各种记录名称, 每列为记录名称所对应的数据域, 许多的行和列组成一张表单, 若干的表单组成 <code>database</code>。</p><ul><li>数据库: 数据库是一些关联表的集合。</li><li>数据表: 表是数据的矩阵。在一个数据库中的表看起来像一个简单的电子表格。</li><li>列: 一列(数据元素) 包含了相同类型的数据, 例如邮政编码的数据。</li><li>行：一行（元组，或记录）是一组相关的数据，例如一条用户订阅的数据。</li><li>主键：主键是唯一的。一个数据表中只能包含一个主键。你可以使用主键来查询数据。</li><li>外键：外键用于关联两个表。</li><li>复合键：复合键（组合键）将多个列作为一个索引键，一般用于复合索引。</li><li>索引：使用索引可快速访问数据库表中的特定信息。索引是对数据库表中一列或多列的值进行排序的一种结构。类似于书籍的目录。</li><li>表头(header): 每一列的名称。</li><li>值(value): 行的具体信息, 每个值必须与该列的数据类型相同。</li></ul>",4)];const t=e(o,[["render",function(e,i,d,o,t,c){return l(),a("div",null,s)}]]);export{d as __pageData,t as default};
